$('.cpf').mask('999.999.999-99');
$('.cep').mask('99.999-999');

$('.rg').keyup(function() {
  $(this).val(this.value.replace(/[^0-9x]*/g, ''));
});

$('.numero').keyup(function() {
  $(this).val(this.value.replace(/[^0-9]*/g, ''));
});

$(".din").maskMoney({
  decimal: ',',
  thousands: '.',
  allowZero:true,
});

$.getCep = function(cep) {
    $.getJSON(`http://cep.republicavirtual.com.br/web_cep.php?cep=${cep}&formato=json`, function(data) {
        if (data.erro) { return false; }
        $('.logradouro').val(data.tipo_logradouro+' '+data.logradouro);
        $('.bairro').val(data.bairro);
        $('.cidade').val(data.cidade); //localidade
        $('.uf').val(data.uf);
        $('.pais').val('Brasil');
        $('.numero').focus();
        return true;
    });
}

